import React from "react";

function Student({
  id,
  name,
  email,
  image, 
  gender
}) {


  return (

    <div id={id}>
        <h1>List of all the Students</h1>

      <h3>{name}</h3>
      <p>
        <strong>{email}</strong>
      </p>
      <img src={image} alt="pic" />
      <h3>{gender}</h3>
    </div>
  );
}

export default Student;
